import React from 'react';
import { TypeAnimation } from 'react-type-animation';




const Project = () => {

  return (
    <div className='about'>
      <div className='banner-text'>
        <TypeAnimation
          cursor={false}
          sequence={[
            'Some of My Projects',
            2000,

          ]}
          wrapper="h2"
          repeat={Infinity}
          style={{ fontSize: '3em', color: 'rgb(34, 32, 32)', letterSpacing: '-2px', fontFamily: 'Rubik Maze', fontWeight: 'lighter' }}
        />
        <hr />
      </div>


      <div class="ui rotate reveal"><div class="ui visible content"><img src="https://react.semantic-ui.com/images/wireframe/square-image.png" class="ui small circular image"/></div><div class="ui hidden content"><img src="https://react.semantic-ui.com/images/avatar/large/stevie.jpg" class="ui small circular image"/></div></div>



    </div>
  )
}

export default Project;
